import React, { Component } from 'react';
import {
  Header,
  Image
} 
from 'semantic-ui-react';
import logo from '../../public/images/dzvun-logo.jpg';


class Body extends Component{
  renderNotLogged = () => {
    return (
      <Header as='h1' textAlign='center'>
        Hi
      </Header>
    );
  }
  renderLogged = () => {
    return (
      <Header as='h1' textAlign='center'>
        Heyyyyy
      </Header>
    );
  }
  render () {
    
    const isLogged = this.props.isLogged;
    if(isLogged) {
      return (
        <div>
        {this.renderLogged()}
        <Image src={logo} size="small"> </Image>
        </div>
      )
    } else {
      return (
        <div>
          {this.renderNotLogged()}
          <img src={logo} alt="Logo" height="100%" width="50px" />
        </div>
      )}
  }
}
export default Body;
